INSERT INTO toa_personnel VALUES ('21040','2','陈彦','43','','2014-09-16 09:57:02','此工程密切关系库区移民群众生产生活，也是移民规划设计漏项的遗留问题。根据成都院的函文，有3个问题提请研酌：一是此种处置方式是否征求了移民群众意见，目前库区地方政府和部门对是否认可同意；二是按成都院的建议修建简易吊桥后，以后是否还需按移民规程规范规定再行复建正式桥梁；三是为应急考虑简化勘测设计深度，仅作类比测算便行实施建设是否稳妥规范，不要因此出现实施即变更情况。','4','1','811','17','0','2','2');
